package android.mobileapp.qrcode.data.storage.entities;import android.arch.persistence.room.Ignore;import android.mobileapp.qrcode.data.DatabaseInfo;import android.os.Parcel;import android.os.Parcelable;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;/** * Created by vuongluis on 4/14/2018. * @author vuongluis * @version 0.0.1 */public class Configure implements Parcelable {    @SerializedName(DatabaseInfo.Configuration.COLUMN_MININUM_VERSION)    @Expose    private String minimumVersion;    @SerializedName(DatabaseInfo.Configuration.COLUMN_NEWEST_VERSION)    @Expose    private String newestVersion;    @Ignore    public Configure(String minimumVersion, String newestVersion) {        this.minimumVersion = minimumVersion;        this.newestVersion = newestVersion;    }    public Configure(){    }    protected Configure(Parcel in) {        minimumVersion = in.readString();        newestVersion = in.readString();    }    public static final Creator<Configure> CREATOR = new Creator<Configure>() {        @Override        public Configure createFromParcel(Parcel in) {            return new Configure(in);        }        @Override        public Configure[] newArray(int size) {            return new Configure[size];        }    };    public String getMinimumVersion() {        return minimumVersion;    }    public void setMinimumVersion(String minimumVersion) {        this.minimumVersion = minimumVersion;    }    public String getNewestVersion() {        return newestVersion;    }    public void setNewestVersion(String newestVersion) {        this.newestVersion = newestVersion;    }    @Override    public int describeContents() {        return 0;    }    public static Creator<Configure> getCREATOR() {        return CREATOR;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        dest.writeString(this.minimumVersion);        dest.writeString(this.newestVersion);    }}